Related issue: https://github.com/borisyankov/DefinitelyTyped/issues/193

Of course we could overload all underscore functions to get jquery as well as array parameters but I think having a common list interface is better.

// Used as common interface between Arrays and jQuery objects
interface IList {
    [index: number]: any;
    length: number;
}

Thanks

The List interface prevents normal use of underscore, i.e.

_.countBy([1, 2, 3], function (item) {
    return item % 2;
});

Using the any[] type allows this usage.

I needed this to author a custom knockout bindingHandler in TypeScript. The bindingHandler invokes ko.utils.setHtml(element, valueAccessor()), similar to how knockout's internal html bindingHandler invokes the same utility function.

Relevant knockout source code:

```
ko.utils.setHtml = function(node, html) {
    ko.utils.emptyDomNode(node);

    // There's no legitimate reason to display a stringified observable without unwrapping it, so we'll unwrap it
    html = ko.utils.unwrapObservable(html);

    if ((html !== null) && (html !== undefined)) {
        if (typeof html != 'string')
            html = html.toString();

        // jQuery contains a lot of sophisticated code to parse arbitrary HTML fragments,
        // for example <tr> elements which are not normally allowed to exist on their own.
        // If you've referenced jQuery we'll use that rather than duplicating its code.
        if (typeof jQuery != 'undefined') {
            jQuery(node)['html'](html);
        } else {
            // ... otherwise, use KO's own parsing logic.
            var parsedNodes = ko.utils.parseHtmlFragment(html);
            for (var i = 0; i < parsedNodes.length; i++)
                node.appendChild(parsedNodes[i]);
        }
    }
};
```

Issue #261:

These `altKey` and `ctrlKey` properties are in class `JQueryInputEventObject`:

```
interface JQueryInputEventObject extends JQueryEventObject
{
    altKey: bool;
    ctrlKey: bool;
    metaKey: bool;
    shiftKey: bool;
}
```

I fixed the event interface orders to solve this problem.

